import { Homepage } from '../Homepage'
import React from 'react'
import { BrowserRouter, Route, Routes } from 'react-router-dom'

// TODO: Add react router
const Router = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/homepage' element={<Homepage />}/>
      </Routes>
    </BrowserRouter>
  )
}

export { Router }
